import React from "react";
import Userentries from "../user-entry";

const Entries = ({ entries }) => {
  return (
    <>
      <section className="entries-wrapper">
        <p>Select an entry to continue</p>
        <Userentries />
      </section>
    </>
  );
};

export default Entries;
